import {TopBar} from './Components.js';
import './App.css';

import React from "react";

function ResourcesCyberSecurityAndPrivacy() {
    return(
        <>
            <TopBar/>
            <div 
    className='background-color-verylightorange' 
    style={{ marginTop: "0px", padding: "50px", display: "flex", justifyContent: "space-between", alignItems: "center" }}
>
    <div>
        <h1>Cybersecurity &<br/> Privacy</h1>
        <p>
            Cybersecurity and privacy are significant issues that can impact a person's daily<br/>
            life. Lebanese authorities, such as Telecommunications Regulatory Authority,<br/>
            the Internal Security Forces, and the Lebanese General Security address relevant<br/>
            issues and advise citizens to be vigilant in the digital world.
        </p>
    </div>
    <img 
        src="Desktop-Lock--Streamline-Flex-Neon.png" 
        alt="security" 
        width="500" 
        height="333"
        style={{ marginLeft: "20px" }} 
    />
</div>

        </>
    );
}

export default ResourcesCyberSecurityAndPrivacy;
